import "../styles/info.css"


export default function Info() {
    return (
        <div>
            <img src={require("../images/userPhoto.png")} className="info--userImg"/>
            <h1 className="info--name">Yosef Buznah</h1>
            <h3 className="info--job">Frontend Developer</h3>
            <h4 className="info--PersonalUrl">yosefbuznah.website</h4>
        </div>
    )
}
